import React from 'react';
import styled from 'styled-components';
import QRCard from './QRCard';
import itera from '../../assets/itera1.svg';
import tester from '../../assets/tester2022.png';
import utvikler from '../../assets/utvikler2022.png';

export function Sommerjobb() {
  return (
    <Wrapper>
      <Header>Klar for tidenes sommerjobb?</Header>
      <Deadline>Søknadsfrist er 1. oktober</Deadline>
      <Ingress>
        Som student hos oss jobber du tverrfaglig på et helt reelt prosjekt ute
        hos en av kundene våre.
      </Ingress>

      <QRCard workTitle={'Utvikler'} qr={tester} />
      <QRCard workTitle={'Tester'} qr={utvikler} />

      <img src={itera} alt='itera' style={{ width: '22vw' }} />
    </Wrapper>
  );
}

const Wrapper = styled.div`
  background-color: #ff4b34;
  padding: 4vw 2vw 3vw;
`;

const Header = styled.h1`
  font-family: 'Neue Machina';
  text-decoration-line: underline;
  margin-bottom: 1vw;
  color: white;
  font-size: 2.9vw;
`;

const Ingress = styled.p`
  font-family: 'IBM Plex Sans';
  font-size: 1.3vw;
  color: white;
`;

const Deadline = styled.p`
  font-family: 'IBM Plex Sans';
  color: white;
  font-size: 1.3vw;
  font-weight: bold;
  margin-bottom: 1vw;
`;
